(1) Evidence of lumbar radiculopathy, including pain in one
or both buttocks or legs for 3 months or greater for at
least 5 days a week and at least one of the following
features on the side corresponding to leg pain:
a. Sharp and shooting pain below the knee;
b. Pain evoked by straight leg raising to 60 or less;
c. Decreased or absent ankle reflex;
d. Weakness of muscles below the knee.
e. Sensory loss in L5/S1 distribution;
f. Electromyographic evidence for L4, L5, or S1 root
denervation;
g. Imaging (MRI, CT/myelogram) evidence of nerve
root compression in the lower lumbar region;
(2) Average leg pain of at least 4/10 for the past month on a
numerical scale of 0–10 where 0 represents no pain and
10 represents the worst possible pain (Jensen et al., 1986);
(3) Willingness to refrain from making changes in nonstudy medications taken for sciatica, and
(4) Age between 18 and 65 years at the start of the study.
The principal investigator (S.K) performed the clinical
examinations. Sensory testing included responses to pinprick, light touch, vibration and joint movement.

